# Find all search result containers and extract titles and urls
results = []
for result in soup.find_all('div', class_='yuRUbf'):
    link = result.find('a')
    if link:
        url = link.get('href')
        title = link.find('h3', class_='LC20lb').get_text() if link.find('h3', class_='LC20lb') else None
        if url and title:
            results.append({
                'url': url,
                'title': title
            })
response_data = results

